import React, { Component } from 'react';
import './App.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';

class App extends Component {
  render() {
    return (
      <div class="container">
      <h2 >CRUD Example</h2>            
      <table class="table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>John</td>
            <td>
              <button class="btn btn-primary a-btn-slide-text" onClick={this.editData}>
                 <span class="glyphicon glyphicon-edit" aria-hidden="true"></span>
                 <span><strong>Edit</strong></span>            
              </button>
                 &nbsp;
                 &nbsp;
              <button class="btn btn-primary a-btn-slide-text" onClick={this.deleteData}>
                 <span class="glyphicon glyphicon-edit" aria-hidden="true"></span>
                 <span><strong>Delete</strong></span>            
              </button>
              &nbsp;
                 &nbsp;
              <button class="btn btn-primary a-btn-slide-text" onClick={this.deleteData}>
                 <span class="glyphicon glyphicon-edit" aria-hidden="true"></span>
                 <span><strong>Read</strong></span>            
              </button>
            </td>
          </tr>

        </tbody>
      </table>
    </div>

    );
  }
}

export default App;
